INSERT INTO `kategori` (`id_kategori`, `nama_kategori`, `deskripsi_kategori`, `created_at`, `updated_at`) VALUES
('KTGR001', 'Alam dan Lanskap', 'Explore keindahan alam yang memukau, dari puncak gunung yang menantang hingga tepian pantai yang menenangkan. Temukan keajaiban alam dalam taman nasional yang mempesona.', '2023-12-01 14:20:45', '2023-12-01 14:20:45'),
('KTGR002', 'Budaya dan Sejarah', 'Masuki dunia kekayaan budaya dan kisah masa lalu di museum penuh misteri, jelajahi situs bersejarah yang mencengangkan, dan rasakan getaran festival tradisional yang memukau.', '2023-12-01 14:20:45', '2023-12-01 14:20:45'),
('KTGR003', 'Hiburan dan Rekreasi', 'Raih kesenangan sejati di taman hiburan yang penuh warna, nikmati sensasi di taman air yang menyegarkan, dan jelajahi pusat perbelanjaan dengan kehidupan malam yang menggairahkan.', '2023-12-01 14:21:37', '2023-12-01 14:21:37'),
('KTGR004', 'Kuliner dan Gastronomi', 'Nikmati perjalanan kuliner yang memikat, dari restoran penuh cita rasa hingga warung makan lokal yang autentik. Jelajahi pasar tradisional yang hidup dan saksikan festival kuliner yang memanjakan lidah.', '2023-12-01 14:21:37', '2023-12-01 14:22:20'),
('KTGR025', 'Petualangan', 'Temukan petualangan luar biasa dengan melibatkan diri dalam olahraga ekstrem yang memacu adrenalin. Rasakan sensasi safari dengan jeep, jelajahi trek tersembunyi, dan telusuri keindahan bawah laut dengan diving dan snorkeling yang mendebarkan.', '2023-12-01 14:22:04', '2023-12-18 14:36:51');

