('OBJ001', 'Raja Ampat', , 'Papua Barat', 'Raja Ampat merupakan salah satu objek wisata Indonesia yang mendunia dan diakui Unesco. Keindahan pemandangan bawah lautnya menjadi daya tarik utama Pulau yang ada di ujung timur Indonesia ini.\r\n\r\nDilansir dari situs Unesco, kecantikan Raja Ampat terletak di sebaran pulau-pulau kecil yang berbatasan dengan air laut, teluk, dan formasi batu karst menciptakan gradiasi warna yang apik. Raja Ampat ini terdiri dari beberapa pulau besar dan bergunung-gunung, dengan yang terbesar yaitu Waigeo, Batanta, Salawati, dan Misool, yang dijuluki Four Kings.', 20, 550000, '09.00 - 17.00', 'KTGR001', '2023-12-02 22:59:59', '2023-12-31 10:19:05');
INSERT INTO `objek_wisata` (`id_objek_wisata`, `nama_objek_wisata`, `gambar_objek_wisata`, `lokasi`, `deskripsi_objek_wisata`, `ketersediaan_tiket`, `harga_tiket`, `jam_operasional`, `kategori`, `created_at`, `updated_at`) VALUES
('OBJ002', 'Gunung Bromo', , 'Jawa Timur', 'Wisata Gunung Bromo merupakan salah satu tempat wisata yang menjadi favorit bagi wisatawan baik dalam maupun luar negeri. Gunung Bromo terletak di Probolinggo, Jawa Timur dan memiliki ketinggian 2.392 Mdpl.', 20, 400000, '10.00 - 16.00', 'KTGR001', '2023-12-02 22:59:59', '2023-12-31 10:19:26');
INSERT INTO `objek_wisata` (`id_objek_wisata`, `nama_objek_wisata`, `gambar_objek_wisata`, `lokasi`, `deskripsi_objek_wisata`, `ketersediaan_tiket`, `harga_tiket`, `jam_operasional`, `kategori`, `created_at`, `updated_at`) VALUES
('OBJ003', 'Pulau Komodo', , 'Nusa Tenggara Timur', 'Pulau Komodo menjadi salah satu magnet wisata di Kabupaten Manggarai Barat, Nusa Tenggara Timur. Di Pulau Komodo ini kamu bisa melihat kehidupan liar komodo dengan tiga macam paket trekking, yaitu short track, medium track, serta long track.\r\n\r\nSelama perjalanan pun kamu akan ditemani pawang yang siap menemani dan mengarahkanmu menjelajahi spot-spot terbaik di Labuan Bajo. Selain itu Labuan Bajo juga menyuguhkan pemandangan hamparan sabana dan laut birunya yang ciamik.', 25, 450000, '10.00 - 17.00', 'KTGR025', '2023-12-02 23:03:08', '2023-12-31 10:19:53');
INSERT INTO `objek_wisata` (`id_objek_wisata`, `nama_objek_wisata`, `gambar_objek_wisata`, `lokasi`, `deskripsi_objek_wisata`, `ketersediaan_tiket`, `harga_tiket`, `jam_operasional`, `kategori`, `created_at`, `updated_at`) VALUES
('OBJ004', 'Wae Rebo', , 'Nusa Tenggara Timur', 'Desa Adat Wae Rebo berada di Distrik Manggarai di Flores, Nusa Tenggara Timur. Desa Adat Wae Rebo ini telah menerima Top Award of Excellence dari Unesco dalam Unesco Asia Pasific Heritage Awards 2012 yang diumumkan di Bangkok pada 27 Agustus 2012.\r\n\r\nDesa kecil dan terpencil ini dikenal karena pembangunan kembali rumah adat Mbaru Niang yang dilandasi semangat gotong royong masyarakat menuju tradisi yang lestari, sekaligus meningkatkan kesejahteraan desanya.\r\n\r\nLokasi-lokasi yang terkenal di Desa Adat Wae Rebo:\r\n\r\na. Pegunungan yang indah dan hutan Todo yang lebat. Di hutan tropis ini kamu bisa menemukan anggrek, berbagai jenis pakis dan banyak burung.\r\n\r\nb. Mbaru Niang\r\n\r\nMbaru Niang merupakan rumah adat di Wae Rebo yang berbentuk kerucut dan seluruhnya tertutup ilalang lontar dari atap hingga ke tanah. Rumah adat ini memiliki lima tingkat yang setiap tingkatnya dirancang untuk tujuan tertentu.', 20, 550000, '09.00 - 16.00', 'KTGR002', '2023-12-02 23:03:08', '2023-12-31 10:20:49');
INSERT INTO `objek_wisata` (`id_objek_wisata`, `nama_objek_wisata`, `gambar_objek_wisata`, `lokasi`, `deskripsi_objek_wisata`, `ketersediaan_tiket`, `harga_tiket`, `jam_operasional`, `kategori`, `created_at`, `updated_at`) VALUES
('OBJ005', 'Mandalika', , 'Nusa Tenggara Barat', 'Mandalika merupakan sirkuit balap internasional yang terletak di Kawasan Ekonomi Khusus Mandalika di Desa Kuta, Lombok Tengah, NTB. Sirkuit ini memiliki panjang lintasan 4,31 km dengan 17 tikungan.\r\n\r\nLokasi-lokasi terkenal di Mandalika:\r\n\r\na. Pantai Kuta\r\n\r\nb. Lagoon', 15, 400000, '10.00 - 16.00', 'KTGR003', '2023-12-02 23:06:11', '2023-12-31 10:22:32');
INSERT INTO `objek_wisata` (`id_objek_wisata`, `nama_objek_wisata`, `gambar_objek_wisata`, `lokasi`, `deskripsi_objek_wisata`, `ketersediaan_tiket`, `harga_tiket`, `jam_operasional`, `kategori`, `created_at`, `updated_at`) VALUES
('OBJ006', 'Bunaken', , 'Manado, Sulawesi Utara', 'Bunaken di Manado, Sulawesi Utara ini telah menjadi salah satu situs warisan Unesco sejak 2005 dan terus dijaga sampai sekarang. Keindahan alam dan keramahan warganya menjadikan kawasan ini sebagai destinasi wisata populer di dalam maupun luar negeri.\r\n\r\nKawasan ini merupakan kawasan konservasi yang ditetapkan Menteri Kehutanan pada 1991. Pemandangan alam bawah lautnya menjadi magnet bagi para penyelam.\r\n\r\nLokasi-lokasi terkenal di Bunaken:\r\n\r\na. Spot selam Malcolm, Bethlehem, Emma Point, dan Rumah Ikan.\r\n\r\nb. Pulau Nain\r\n\r\nc. Pulau Mantehage\r\n\r\nd. Pulau Siladen\r\n\r\ne. Pulau Manado Tua.', 20, 600000, '08.00 - 16.00', 'KTGR003', '2023-12-02 23:06:11', '2023-12-31 10:23:31');
INSERT INTO `objek_wisata` (`id_objek_wisata`, `nama_objek_wisata`, `gambar_objek_wisata`, `lokasi`, `deskripsi_objek_wisata`, `ketersediaan_tiket`, `harga_tiket`, `jam_operasional`, `kategori`, `created_at`, `updated_at`) VALUES
('OBJ007', 'Tana Toraja', , 'Sulawesi Utara', 'Tana Toraja di Sulawsi Utara ini kental dengan adat dan budaya. Ada beragam destinasi wisata yang menarik dikunjungi di Tana Toraja, mulai dari budaya hingga alam.\r\n\r\nLokasi-lokasi terkenal di Toraja:\r\n\r\na. Gua Lemo\r\n\r\nGua Lemo merupakan makam bagi para bangsawan Tana Toraja. Makam ini merupakan perbukitan kapur dan dihiasi dengan ragam patung kayu yang dibentuk menyerupai orang yang sudah meninggal dan jasadnya dimakamkan ke dalam batu.\r\n\r\nb. Patung Buntu Yesus Burake\r\n\r\nPatung Yesus ini berada di atas Bukit Buntu Burake. Patung ini dibangun dengan mereplikasi gaya patung yang ada di Rio de Janeiro, Christ the Redeemer. Tak hanya patung Yesus, kamu juga bisa melihat jembatan kaca yang mengelilinginya. Jembatan kaca sepanjang 90 emter ini disebut yang terpanjang di Indonesia.\r\n\r\nc. Desa Pallawa\r\n\r\nDi desa ini kamu bisa menemukan rumah adat tertua di Sulawesi, tongkonan. Rumah adat ini merupakan kawasan desa yang bersejarah dan masih terjaga keasriannya. Ada 11 rumah tongkonan dengan alat penumbuk padi tradisional di desa ini.', 20, 650000, '08.00 - 16.00', 'KTGR002', '2023-12-02 23:09:35', '2023-12-31 10:24:43');
INSERT INTO `objek_wisata` (`id_objek_wisata`, `nama_objek_wisata`, `gambar_objek_wisata`, `lokasi`, `deskripsi_objek_wisata`, `ketersediaan_tiket`, `harga_tiket`, `jam_operasional`, `kategori`, `created_at`, `updated_at`) VALUES
('OBJ008', 'Borobudur', , 'Jawa Timur', 'Borobudur merupakan salah satu kabupaten di Magelang, Jawa Tengah yang terkenal dengan candi Buddha. Candi ini dibangun Raja Samaratungga dari Dinasti Syailendra pada abad ke-8.\r\n\r\nCandi Borobudur memiliki relief yang menggambarkan kehidupan sang Buddha dan reinkarnasinya dalam bentuk cerita Jataka dan Lalitavistara.\r\n\r\nObjek wisata di Borobudur:\r\n\r\na. Candi Umbul\r\n\r\nb. Candi Mendut\r\n\r\nc. Gereja Ayam\r\n\r\nd. Svargha Bumi\r\n\r\ne. Puthuk Setumbu', 50, 550000, '09.00 - 16.00', 'KTGR002', '2023-12-02 23:09:35', '2023-12-31 10:26:42');
INSERT INTO `objek_wisata` (`id_objek_wisata`, `nama_objek_wisata`, `gambar_objek_wisata`, `lokasi`, `deskripsi_objek_wisata`, `ketersediaan_tiket`, `harga_tiket`, `jam_operasional`, `kategori`, `created_at`, `updated_at`) VALUES
('OBJ009', 'Pulo Cinta', , 'Gorontalo', 'Pulo Cinta di Teluk Tomni Gorontalo adalah salah satu destinasi wisata yang dikenal sebagai Maldivesnya Indonesia. Disebut Pulo Cinta karena bentuk yang mirip dengan jantung hati.\r\n\r\nKeindahan alamnya semakin apik dengan lanskap pantai berpasir putih. Pulo Cinta kini telah dibangun resort sehingga sudah tertata apik. Kamu bisa menikmati sunset dan sunrise dari balkon kamar. Aktivitas lainnya kamu bisa menyelam, snorkeling, dan berfoto ria.\r\n\r\nLokasi terkenal di Pulo Cinta:\r\n\r\na. Cottage Pulo Cinta\r\n\r\nDesain cottage ini berbentuk hati dengan jembatan kayu yang menghubungkan cottage satu dengan yang lainnya.\r\n\r\nb. Landscape Pulo Cinta\r\n\r\nDi lokasi ini kamu bisa melihat hamparan laut yang jernih dan berwarna turqoise. Kamu bisa bermain ayunan di tengah laut yang seru.\r\n', 20, 500000, '09.00 - 16.00', 'KTGR001', '2023-12-02 23:12:27', '2023-12-31 10:27:46');
INSERT INTO `objek_wisata` (`id_objek_wisata`, `nama_objek_wisata`, `gambar_objek_wisata`, `lokasi`, `deskripsi_objek_wisata`, `ketersediaan_tiket`, `harga_tiket`, `jam_operasional`, `kategori`, `created_at`, `updated_at`) VALUES
('OBJ010', 'Way Kambas', , 'Lampung', 'Taman Nasional Way Kambas di Lampung merupakan salah satu kawasan konservasi. Mengutip situsnya, Way Kambas dibangun untuk pelestarian dan melindungi kawasan yang kaya akan berbagai satwa liar.\r\n\r\nLokasi wisata ini juga dikenal sebagai hunian The Big Five Mammals yaitu tapir (Tapirus indicus), gajah Sumatera (Elephant maximus sumatranus), harimau Sumatera (Panthera tigris), badak Sumatera (Diserohinus sumatranus) dan beruang madu (Helarctos malayanus).\r\nKelima hewan mamalia besar tersebut masih terpelihara dan dirawat dengan baik di Way Kambas.\r\n\r\nObjek wisata di Way Kambas:\r\n\r\na. Atraksi gajah\r\n\r\nKamu bisa melihat atraksi gajah yang bisa berjoget, parade, bahkan menendang bola.\r\n\r\nb. Memandikan gajah\r\n\r\nKamu juga bisa ikut memandikan gajah. Siapa sangka satwa berbelalai panjang dan bertubuh besar itu juga manja saat dimandikan dan bermain air.\r\n\r\nc. Resort Way Kanan\r\n\r\nWay Kanan merupakan salah satu kawasan minat khusus seperti pengamatan satwa siamang, safari susur sungai Way Kanan-Kuala Kambas, Kali Biru.\r\n', 20, 550000, '09.00 - 16.00', 'KTGR003', '2023-12-02 23:12:27', '2023-12-31 10:29:02');
